// Acessa o array "retorno" do item atual
const array = $json.retorno;

// Garante que é um array válido
if (!Array.isArray(array)) {
  throw new Error('O campo retorno não é um array');
}

// Transforma o array em objeto indexado pelo id
const obj = {};
array.forEach(item => {
  obj[item.id] = item;
});

// Retorna um único item, objeto como $json
return [{ json: obj }];

// Se o objeto indexado está em $json (ou $json.dados, ajuste se necessário)
const dados = $json.dados ? $json.dados : $json; // flexível

// ID atual vindo do Get Row
const idAtual = $('Get row(s) in sheet').first().json.id // já disponível no item!

// Filtra os IDs maiores
const idsFiltrados = Object.keys(dados)
  .map(Number)
  .filter(id => id > Number(idAtual));

idsFiltrados.sort((a, b) => a - b);

const result = idsFiltrados.map(id => dados[id.toString()]);

return result.map(obj => ({ json: obj }));
